import axios from "axios";

const INVESTMENT_BASE = "http://localhost:80/Investments/allcapital";
const INVESTMENT_ACTUAL = "http://localhost:80/Investments/allactual";
const INVESTMENT_BENEFICE = "http://localhost:80/Investments/allbenefice";

const result = [
{
    "BASE" : {INVESTMENT_BASE}   ,
    "ACTUAL" : {INVESTMENT_ACTUAL}  ,
    "BENEFICE" : {INVESTMENT_BENEFICE}

}
];

export default result;
